export const rudderKey = "1WqQrrHeUXIjTPXIUatX1DBYDtm";
console.log("rudder sdk loaded");
console.log("rudder sdk key" + rudderKey);

export function eventIdentify() {

    var rudderanalytics = global.window.rudderanalytics = global.window.rudderanalytics || [];
    var analytics = global.window.analytics = global.window.analytics || [];
    rudderanalytics.identify("Keen Identify Call from Rudder", {
        name: "Sajal Mohanta",
        category: "SampleIdentify",
        email: "sajal@abc.com",
        plan: "Open source",
        logins: 5
    },
        {
            context: {
                ip: '0.0.0.0',
            },
            page: {
                path: 'sdsd',
                referrer: 'dsds',
                search: 'ssss',
                title: 'dddsdsd',
                url: 'sdsdsadd'
            },
             anonymousId: "dsknkcnd",
        });
        analytics.identify("Keen Identify Call from Segment", {
            name: "Sajal Mohanta",
            category: "SampleIdentify",
            email: "sajal@abc.com",
            plan: "Open source",
            logins: 5
        },
            {
                context: {
                    ip: '0.0.0.0',
                },
                page: {
                    path: 'sdsd',
                    referrer: 'dsds',
                    search: 'ssss',
                    title: 'dddsdsd',
                    url: 'sdsdsadd'
                },
                 anonymousId: "dsknkcnd",
            });
    console.log("rudder identify call");
}

export function eventPage() {
    var rudderanalytics = global.window.rudderanalytics = global.window.rudderanalytics || [];
    var analytics = global.window.analytics = global.window.analytics || [];
    rudderanalytics.page('Keen Application Loaded from Rudder',
        {
            path: 'path',
            referrer: 'referrer',
            search: 'search',
            title: 'title',
            url: 'url',
        },
        {
            context: {
                ip: '0.0.0.0'
            },
             anonymousId: '00000000000000000000000000'
        });

        analytics.page('Keen Application Loaded from Segment',
        {
            path: 'path',
            referrer: 'referrer',
            search: 'search',
            title: 'title',
            url: 'url',
        },
        {
            context: {
                ip: '0.0.0.0'
            },
             anonymousId: '00000000000000000000000000'
        });
    console.log("rudder page call");
}

export function eventTrack() {
    var rudderanalytics = global.window.rudderanalytics = global.window.rudderanalytics || [];
    var analytics = global.window.analytics = global.window.analytics || [];
    rudderanalytics.track('Track Call test for Keen from Rudder',
        {
            path: 'path',
            referrer: 'referrer',
            search: 'search',
            title: 'title',
            url: 'url',
        },
        {
            context: {
                ip: '0.0.0.0'
            },
             anonymousId: '00000000000000000000000000'
        });


        // rudderanalytics.track('Experiment Viewed', {
        //     experiment_id: 'home-page-title-2819',
        //     variation_name: 'Variation 1'
        //   });

        analytics.track('Track Call test for Keen from Segment',
        {
            path: 'path',
            referrer: 'referrer',
            search: 'search',
            title: 'title',
            url: 'url',
        },
        {
            context: {
                ip: '0.0.0.0'
            },
             anonymousId: '00000000000000000000000000'
        });

        // rudderanalytics.alias("new-user-id");
        // analytics.alias("new-user-id");


        // analytics.track('Track Call2',
        // {
        //     path: '',
        //     referrer: '',
